  \"2015-08-14T06:38:34.266556\",\n\t\"name\": \"efficient-estimation-of-spectral-moments-and-the-polarimetric-variables-on-weather-radars--3a881\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A method for estimation of Doppler spectrum,
  its moments, and polarimetric variables on pulsed weather radars which uses over
  sampled echo components at a rate several times larger than the reciprocal of transmitted
  pulse length. The variables are estimated by suitably combining weighted averages
  of the over sampled signals in range with usual processing of samples at a fixed
  range location. The invention may be Used on pulsed weather radar, lidars, sonars
  and accoustic flow meters.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
